    // Determine the payload based on the sequence data and position target
    if (sequenceData === 9) {
        if (positionTarget === 0) {
            payload = -42;
        } else if (positionTarget === 1) {
            payload = -33;
        } else if (positionTarget === 2) {
            payload = -26;
        } else if (positionTarget === 3) {
            payload = -23;
        } else if (positionTarget === 4) {
            payload = -25;
        } else if (positionTarget === 5) {
            payload = -28;
        } else if (positionTarget === 6) {
            payload = -41;
        }
    } else if (sequenceData === 7 || sequenceData === 11) {
        payload = 0;
    } else if (sequenceData === 3 || sequenceData === 14) {
        payload = -42;
    } else if (sequenceData === 0) {
        let cylinderStatus = global.get('cylinder_status');
        if (cylinderStatus === true) {
            payload = -41;
        } else {
            payload = 0;
        }
    }

    // Create and send the message
    if (payload !== undefined) {
        let msg = {
            payload: payload,
            topic: `position${positionTarget}@data`
        };
        node.send(msg);
    }
}

